import React, { useState } from "react";
import "../App.css";

function ProjectsDisplay() {

    const img_styles = {       
        height: "auto",
        boxshadow: "0 0 10px rgba(0, 0, 0, 0.1)",
        alignitems: "center",   
    };

    const [activeProject, setActiveProject] = useState("project1");

    const projects = {
        project1: {
            name: "Stochastic Volatility Model (Heston Model) Simulation",
            content: "/Figure_1_resized.png"
        },
        project2: {
            name: "Implemented Google Page Rank using Markov Decision Process",
            content: "https://via.placeholder.com/600x400.png?text=Mobile+App"
        },
        project3: {
            name: "Implemented Simple multi-layer perceptron using just numpy",
            content: "https://via.placeholder.com/600x400.png?text=Machine+Learning+Model"
        },
        project4: {
            name: "Implemented a recommender system using collaborative filtering",
            content: "https://via.placeholder.com/600x400.png?text=Recommender+System"

        }
    };

    const renderProjectListItems = () =>
        Object.entries(projects).map(([key, project], index, array) => (
            <React.Fragment key={key}>
                <li onClick={() => setActiveProject(key)} className={activeProject === key ? "activelis" : ""} id={"project" + index}>
                    {project.name} 
                </li>
                <hr className="proj-hr" />
            </React.Fragment>
        ));

    return (
    <div className="PROJ">
        <h1 className="PROJH">Projects</h1>
        <div className="flex-containerp">
            <div className="proj-list-container">
                <ul>
                    {renderProjectListItems()}
                </ul>
            </div>
            <div>
                <p> 
                    The below example is 10,000 simulations of SPY starting from 3 years ago until now. A small write-up and the source code for the 
                    implementation of the Heston model using both the Euler and Milstein discretization methods can be found on the Github link above.
                </p>
                <img 
                    style={img_styles}  
                    src={projects[activeProject].content} 
                    alt="project"
                    onLoad={() => console.log('Image loaded')}
                    onError={() => console.log('Image failed to load')}
                />
            </div>
        </div>
    </div>
    );
}

export default ProjectsDisplay;
